//This is just an example file for testing assignment links
import React from "react";
import { useState } from "react";

export default function AsgmtPage(props) {
  return (
    <>
      <span>Assignment name: {props.location.state.name}</span>
      <span>Terms: {props.location.state.terms}</span>
    </>
  );
}
